```
public interface Animal {

default void greet(Animal a) {
print("hello animal"); }

default void sniff(Animal a) {
print("sniff animal"); }

default void praise(Animal a) {
print("u r cool animal"); }

}

public class Dog implements Animal {

//default void greet(Animal a)//

@Override  //override
 void sniff(Animal a) {
print("dog sniff animal"); }

//default void praise(Animal a)//
//override
void praise(Dog a) {
print("u r cool dog"); }

}

**

Animal a = new Dog();

Dog d = new Dog();

a.greet(d); // greet(Animal a) - hello animal//

a.sniff(d); // sniff(Animal a) - dog sniff animal//
**`a.sniff(d);`**
    `a`  `Animal` `Animal.sniff(Animal a)`
    `a`  `Dog``sniff`  `Dog`             `Dog.sniff(Animal a)`

d.praise(d);// praise(Dog a) - u r cool dog//ddog

a.praise(d);// praise(Animal a) - u r cool animal//aanimalanimal
// . 

    `a`  `Animal` `Animal.praise(Animal a)`
    `a`  `Dog` `praise`       `Animal.praise(Animal a)`
    `u r cool animal`

**
```


